import { NavConatiner, DataWrapper, LogoImage } from 'styles/Navbar'
import Logo from 'assets/images/logo.png'

const Navbar = () => {
  return (
    <NavConatiner>
      <LogoImage src={Logo} />
      <DataWrapper>
        <span></span>
      </DataWrapper>
    </NavConatiner>
  )
}

export default Navbar
